import React from "react";
import Sidebar from "../sidebar/Sidebar";
import Navbar from "../navbar/Navbar";


const Rooms = () => {
  return (
    <div className="home">
      <Sidebar />
      <div className="homecontainer">
        <Navbar />
        <div className="containet">
          <div class=" flex justify-center pt-10 ">
            <div className=" w-40 h-16 bg-slate-500 pl-2 ml-3" >01</div>
            <div className=" w-40 h-16 bg-slate-500 pl-2 ml-3" >02</div>
            <div className=" w-40 h-16 bg-slate-500 pl-2 ml-3" >03</div>
            <div className=" w-40 h-16 bg-slate-500 pl-2 ml-3" >04</div>
            <div className=" w-40 h-16 bg-slate-500 pl-2 ml-3" >05</div>
            <div className=" w-40 h-16 bg-slate-500 pl-2 ml-3" >06</div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Rooms;
